const STYLE = `
svg{
    width: 50vw;
    height: 50vh;
  }

  path {
    stroke-dasharray: 1; /* the length of the dashes that make up the length make this longer than the line itself, if its not, the line will only appear partially or of course with dashes.*/
    stroke-dashoffset: 1; /* set the initial dashoffset such that the line can't be seen. (afters setting stroke-dasharray to a really big value)*/
    animation-fill-mode: forwards;
  }

  .Coordinate-System{
      animation: dash 1s linear;
      animation-delay: 0s;
      animation-fill-mode: forwards;
  }

  .Coordinate-System-Tick{
      animation: dash 0.5s linear;
      animation-delay: 1s;
      animation-fill-mode: forwards;
  }

  .Graph{
      animation: dash 2s linear;
      animation-delay: 1.5s;
      animation-fill-mode: forwards;
  }

  .Riemann-Rectangle{
      animation: dash 2s linear;
      animation-delay: 3.5s;
      animation-fill-mode: forwards;
  }

  .Latex{
      animation: dash 2s linear;
      animation-delay: 3.5s;
      animation-fill-mode: forwards;
  }

  @keyframes dash{
    from {
      stroke-dashoffset: 1; /* Animate the stroke offset to zero*/
    }
    to {
      stroke-dashoffset: 0; /* Animate the stroke offset to zero*/
    }
  }
`

