function startAnimation(){

    // get all the svg paths and add the 'pathLength' attribute equal to 1 to start the CSS animation
    const html_collection_of_svg_paths = document.getElementsByTagName('path')
    const list_of_svg_paths = [...html_collection_of_svg_paths]
    list_of_svg_paths.forEach((html_svg_path_element, counter_index)=>{
        html_svg_path_element.setAttribute('pathLength', '1')
    })

    // colors used to differentiate between different elements of the svg and delay their animation start individually
    const graph_green = '#32BF0E'
    const riemann_rectangle_green = '#1AC572'
    const coordinate_system_blue = '#123C5F'
    const coordinate_system_ticks_blue = '#32648E'
    const latex_font_color = 'black'

    list_of_svg_paths.forEach((html_svg_path_element, counter_index)=>{
        const color_id =  html_svg_path_element.getAttribute('stroke')
        if (color_id === graph_green){
            html_svg_path_element.classList.add('Graph')
        }
        else if (color_id === riemann_rectangle_green){
            html_svg_path_element.classList.add('Riemann-Rectangle')
        }

        else if (color_id === coordinate_system_blue){
            html_svg_path_element.classList.add('Coordinate-System')
        }

        else if (color_id === coordinate_system_ticks_blue){
            html_svg_path_element.classList.add('Coordinate-System-Tick')
        }

        else if (color_id === latex_font_color){
            html_svg_path_element.classList.add('Latex')
        }
        else {
            // console.log("No color match found, color : ", color_id, " of type", typeof(color_id))
        }

    })

}

class CustomSVGElement extends HTMLElement {
    connectedCallback() {
        const style = document.createElement('style')
        style.innerHTML = STYLE
        this.append(style)

        const svg_wrapper = document.createElement('div')
        svg_wrapper.innerHTML = SVG
        this.append(svg_wrapper)

        startAnimation()
    }

}
customElements.define('custom-svg-element', CustomSVGElement);